import Pocetna from "./Pocetna";
import Checkout from "./Checkout";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";

function App() {
  return (
    <Router>
      <Switch>
        <Route exact path="/">
          <Pocetna></Pocetna>
        </Route>
        <Route path="/checkout">
          <Checkout></Checkout>
        </Route>
      </Switch>
    </Router>
  );
}

export default App;
